import Foundation

struct IsomorphicStrings {
    /// âœ… https://leetcode.com/problems/isomorphic-strings/description/
    func isIsomorphic(_ s: String, _ t: String) -> Bool {
        var replacing: [Character: Character] = [:]
        var taken: Set<Character> = []
        let sarray: [Character] = .init(s)
        let tarray: [Character] = .init(t)
        for i in 0..<s.count {
            let sChar: Character = sarray[i]
            let tChar: Character = tarray[i]
            if let char: Character = replacing[sChar] {
                if tChar != char {
                    return false
                }
            } else {
                if taken.contains(tChar) { return false }
                taken.insert(tChar)
                replacing[sChar] = tChar
            }
        }
        return true
    }
    
